  false,\n\t\"url\": null,\n\t\"notes\": \"The Inventory and Monitoring Plan (IMP)
  identifies the surveys that a refuge intends to conduct over the next 15 years and
  briefly describes the purpose, management context, and partnerships involved in
  those surveys. A survey is defined as: u201ca specific data-collection effort to
  complete an inventory or conduct monitoring of biotic or abiotic resources (701
  FW 2).u201d We expand the definition of survey here to include research. Survey
  information is also maintained in the Planning and Review of Inventory and Monitoring
  on Refuges (PRIMR) database. The IMP provides the rationale for the ranking and
  selection of surveys. Due to budget and personnel constraints, it is necessary for
  refuge management to prioritize surveys in light of their importance for informing
  management decisions, addressing treaty and policy obligations, and assessing progress
  toward meeting refuge goals, objectives and purposes.\",\n\t\"license_title\": \"License
